function signin(e){$.ajax({type:"POST",url:serverURL+"register",data:e,success:function(e){window.location.href="login.html"},error:function(e,o,t){console.log(e.status),console.log(t),window.alert("Registration Failed")}})}var serverURL="https://project3pockety.herokuapp.com/";$(function(){$("#register-form").on("submit",function(e){e.preventDefault();var o=$(this).serialize();signin(o)})});